        }

        }
        .slider{
            width: 96%;
            height: 100%;
            margin: 0 auto;
            position: relative;
            border: 1px solid red;
        }
        .slides{
            width: 10000px;
            height: 100%;
            display: flex;
            align-items: center;
            position: absolute;
            top: 0;
            left: -96vw;
            transition: 1s;
        }
        .slide{
            width: 96vw;
            height: 100%;
            padding: 10px;
            transition: 1s;
        }
        .slide img{
            width: 100%;
            height: 100%;
            border-radius: 10px;
        }
